<script>
    var tshardow = document.getElementById("tshardow");
    var star = document.getElementById("STAR");
    var shardow = document.getElementById("shardow");
    var car = document.getElementById("Car");
    var mond = document.getElementById("mond");
    var light = document.getElementById("light");
    
    mond.addEventListener("click", function () {
        mond.style.display = "inline";
        star.style.visibility = "visible";
    });
    
    light.addEventListener("click", function () {
        tshardow.style.visibility = "visible";
    });
    
    tshardow.addEventListener("click", function () {
        shardow.style.visibility = "visible";
        car.style.display="inline";
        
    });
    
    var msg = false;
    star.addEventListener("click", function () {
        
        if (msg == false){
        var text = document.createElement("img");
        text.src = "ctext.svg";
        text.style.position = "fixed";
        text.style.bottom = "0";
        text.style.top = "0";
        text.style.left = "0";
        text.style.right = "0";
        text.style.margin = "auto";
        document.body.appendChild(text);
        msg = true;
            
        text.addEventListener("click", function(){
            document.body.removeChild(text);
        })
        }
    });
    
    car.addEventListener("click", function () {
        window.location = "Fifth.html";
    })
        </script>
